syntax = "proto3";

message Module {
  message stars__UnionBuilder {
     bool nullField  = 1;
     sint64 int__unionField  = 2;
  }

  message id__UnionBuilder {
     sint64 int__unionField  = 1;
     string string__unionField  = 2;
  }

  message Contributor {
     bytes img  = 1;
     string username  = 2;
  }

   repeated Contributor contributors  = 1;
   id__UnionBuilder id  = 2;
   string name  = 3;
   stars__UnionBuilder stars  = 4;
}
